import React, { Component } from "react"
import { connect } from "react-redux"
import Navbar from "./Navbar"
import Input from "./Input"
import Navbar_logout from "./Navbar_logout"
import { Wrap, TextContainer, Text, SubText, Line } from "./styles/header"

class Header extends Component {
  render() {
    return (
      <Wrap>
        {this.props.isLoggedIn ? <Navbar_logout /> : <Navbar />}
        <TextContainer>
          <Text>
            Ready for A <Line>Holiday</Line>?
          </Text>
          <SubText> CHECK OUT OUR LATEST PROMOTION </SubText>
          <Input />
        </TextContainer>
      </Wrap>
    )
  }
}
const mapStateToProps = (state) => ({
  isLoggedIn: state.header.isLoggedIn,
})

export default connect(mapStateToProps, null)(Header)
